import React from 'react';
import { connect, useSelector } from "react-redux";
import LoginAuth from '../Authorization/LoginAuth';


function Home(props) {

    const flagAuth = useSelector(state => state.stateAuthorization.user.password); 
    const flagLoginConfirmed = useSelector(state => state.stateAuthorization.user.flagLoginConfirmed); 
    //const a = {flagAuth === "notConfirmed" ?
    //                    <LoginAuth />
    //                    : null
    //            }
    return(
         <div>
                <div className="">
                HOME
                </div>
            {
                flagLoginConfirmed === true?
                    <LoginAuth />
                    : <div> не правильный логин</div>
            }

           
                 

            


                
        </div>
    )
}

export default connect()(Home)
